summary:
Foluke is a senior agronomist with international work experience. Fields of experience and expertise include: cropping systems, food security, valorisation of agro-waste, gender issues, sustainability criteria of renewable energy, biobased economy and innovations for regional development.

- Subsistence farming: cropping systems and sustainable land use (agroforestry systems for production of food, feed and fuel in North Sudan; home gardens in Solomon Islands and PNG);
- Monitoring and evaluation of bioenergy production from agro waste: technical, economic, environmental and social performance (coffee residues and palm oil waste water);
- Trends and calamities and their impacts on food security. Including climate change, scarcity of natural resources, dependence of the feed industry on soybean protein;
- Valorization of agro waste streams (design and evaluation of biogas and ethanol systems, e.g. potato, coffee, oil palm, wheat, sugar cane, sugar beet);
- Sustainable management and protection of natural resources and ecosystems (FSC group certification of tropical timber in The Solomon Islands);
- Farmer groups and agro chain development (palm oil processing, vanilla production, certification and trade of certified timber); 
- Awareness raising and extension (training of trainers in Sierra Leone, Guinea Conakry and Sudan; establishment of training centres in Sudan; training and awareness raising in The Solomon Islands);
- Life Cycle Assessment (LCA); Greenhouse gas (GHG) calculations; carbon balances;
- International bioenergy certification systems (Dutch NTA8080; ISO standards); 
- Professional standard in research, data analysis and presentation.
